v.x:
var $bm_rt;
var degreesX, xRad, degreesY, yRad, aSide, bSide, cSide, newAcos, newAcos, newAcos, newAcos, newAsin, newAsin, newAtan;
degreesX = effect('AngleX')('Angle');
xRad = degreesToRadians(degreesX);
degreesY = effect('AngleY')('Angle');
yRad = degreesToRadians(degreesY);
aSide = Math.cos(xRad);
bSide = $bm_mul(Math.sin(xRad), Math.sin(yRad));
cSide = Math.sqrt($bm_sum($bm_mul(aSide, aSide), $bm_mul(bSide, bSide)));
if (Math.cos(xRad) >= 0) {
    if (Math.cos(yRad) >= 0) {
        newAcos = cSide;
    } else {
        newAcos = $bm_neg(cSide);
    }
} else {
    if (Math.cos(yRad) >= 0) {
        newAcos = $bm_neg(cSide);
    } else {
        newAcos = cSide;
    }
}
if (Math.sin(xRad) >= 0) {
    newAsin = Math.sqrt($bm_sub(1, $bm_mul(cSide, cSide)));
} else {
    newAsin = $bm_neg(Math.sqrt($bm_sub(1, $bm_mul(cSide, cSide))));
}
newAtan = $bm_div(newAsin, newAcos);
$bm_rt = $bm_div($bm_mul(Math.atan(newAtan), 180), Math.PI);

var $bm_rt;
var degreesX, xRad, degreesY, yRad, aSide, bSide, newAtan;
degreesX = effect('AngleX')('Angle');
xRad = degreesToRadians(degreesX);
degreesY = effect('AngleY')('Angle');
yRad = degreesToRadians(degreesY);
aSide = Math.cos(xRad);
bSide = $bm_mul(Math.sin(xRad), Math.sin(yRad));
newAtan = $bm_div(bSide, aSide);
$bm_rt = $bm_sum(value, $bm_div($bm_mul(Math.atan(newAtan), 180), Math.PI));

